USE StudyBuddy;

CREATE TABLE users(
    name Varchar(30) not null,
    email Varchar(50) not null,
    pass_word Varchar(20) not null,
    id int PRIMARY KEY AUTO_INCREMENT,
    is_parent BIT default 0,
    child_id int default null
);



CREATE TABLE assignments(
    name Varchar(100) not null,
    id int PRIMARY KEY AUTO_INCREMENT,
    user_id int,
    hours_needed int default 0,
    minutes_spent int default 0,
    completed BIT default 0,
    total_breaks int default 0,
    feeling int default 50,
    breaks_taken int default 0,
    FOREIGN KEY (user_id) references users(id) ON DELETE CASCADE ON UPDATE CASCADE
);



CREATE TABLE work_sessions(
    work_day DATE, 
    assignment_id int not null,
    id int PRIMARY KEY AUTO_INCREMENT,
    minutes_spent int not null,
    FOREIGN KEY (assignment_id) references assignments(id) ON DELETE CASCADE ON UPDATE CASCADE
);


CREATE TABLE log_ons(
    session_day DATE ,
    user_id int not null,
    id int PRIMARY KEY AUTO_INCREMENT,
    minutes_spent int not null,
    FOREIGN KEY (user_id) references users(id) ON DELETE CASCADE ON UPDATE CASCADE
);
